const MyContact = ({contactTitle, contactValue}) => {
    /*return <span>
        <b>{contactTitle}:</b> {contactValue}
    </span>*/
    {contactValue &&
        <span>
        <b>{contactTitle}:</b> {contactValue}
    </span>
    }
}

export default MyContact;
